import { TextField } from "@material-ui/core";

export default function Signup(){
    return(
        <div>
            <div>Register</div>
            <div>
            <TextField size="small" label="Enter Admin/User" name="admin" variant="outlined"/>
            <TextField size="small" label="Enter Email" name="email" variant="outlined"/>
            <TextField size="small" label="Enter Username" name="username" variant="outlined"/>
            <TextField size="small" label="Enter Mobile Number" name="mobile" variant="outlined"/>
            <TextField size="small" label="Enter Password" name="pass" variant="outlined"/>
            <TextField size="small" label="Confirm Password" name="password" variant="outlined"/>
            </div>
        </div>
    )
}
